webpackJsonp([0xa479a019dfb5],{794:function(n,e){n.exports={data:{markdownRemark:{frontmatter:{title:"OZERO",type:"lyrics"},html:"<h1>OZERO</h1>\n<section>\n<p>Vecher tih.<br>\nNacherti<br>\nna vode,<br>\novod gde,<br>\nmokryj znak — <br>\nmog li znat',<br>\nkak vecher ih<br>\ntih.</p>\n<p>Mal'chik v lodke rechku trogal,<br>\nili lodka tjanet vodu.<br>\nRuki zakatav v tjul'pany,<br>\nmal'chik tjanet odejalo.</p>\n<p>Jeto solnce v kamyshah<br>\nPrjachet zoloto v meshkah.<br>\nJeto vremja na vode<br>\nVodomerkoj delit den'.</p>\n<p>Jeto caplja — chasovoj — <br>\nPravoj tikaet nogoj.<br>\nJeto mal'chik v lodke lishnej<br>\nZacvetaet beloj vishnej.</p>\n<p>Vecher tih.<br>\nNacherti<br>\nna vode,<br>\novod gde,<br>\nmokryj znak — <br>\nmog li znat',<br>\nkak vecher ih<br>\ntih.</p>\n<p>Jetu lodku utopi<br>\nutkoj pojmannoj v topi<br>\ni s ljagushkami iz voska<br>\ns golovoj nyrni v izvjostku</p>\n<p>Ryby plavnoj cheshujoj<br>\nVodu gladjat pod vodoj<br>\nI smykajut puzyrjami<br>\nto, chto my eshhjo ne znaem.</p>\n<p>Jeto vecher — zelen ljon — <br>\ntjanet serdce na buton.<br>\nV jetot vecher, vremja skvoz'<br>\nSerdce s ozerom splelos'.</p>\n</section>"},site:{siteMetadata:{languages:{defaultLangKey:"en",langs:["en","ru"]}}}},pathContext:{slug:"/en/lyrics/ozero/"}}}});
